            " + \'\' + \',\' +\r\nIsNull(A1.Country,\'\') + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + Is" +
            "Null(A2.U_NomDepartamento,\'\') + \',\' + \'\' + \',\' + IsNull(A3.Name,\'\') + \',\' +\r\nCas" +
            "e When CharIndex(\'-\', A0.TaxIdNum) != 0 Then SubString(A0.TaxIdNum, CharIndex(\'-" +
            "\', A0.TaxIdNum)+1, Len(A0.TaxIdNum)) Else \'\' End \r\n+ \',\' + IsNull(A0.U_HBT_MunMe" +
            "d,\'\') + \',\' + IsNull(A0.PrintHeadr,\'\') + \',\' +  IsNull(A0.U_SEI_FEActEco,\'\') as " +
