            "MUNICIPIO\" A2 On A0.U_HBT_MunMed = A2.Code\r\nLeft Join OCRY A3 On A0.Country = A3" +
            ".Code\r\n\r\nUnion All\r\n\r\nSelect \'TAC\' + \',\' + IsNull(A3.\"U_Codigo\",\'\') + \',\' + \'\' +" +
            " \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \'," +
            "\' + \'\' + \',\' + \'\' As \'Cadena\'\r\nFrom OADM A0\r\nInner Join (SELECT Top 1 T1.\"Code\" " +
            ", \"U_Codigo\"=STUFF(\r\n\t\t\t\t(SELECT \';\' + \"U_Codigo\" AS [text()]\r\n\t\t\t\t\tFROM \"@FEDIA" +
            "N_SN_RESPO\" XT\r\n\t\t\t\t\tWhere \"Code\" = (Select \"TaxIdNum\" From \"OADM\")\r\n\t\t\t\t\tOrder " +
            "By \"U_Codigo\"\r\n\t\t\t\t\tFOR XML PATH(\'\')), 1, 1, \'\') \r\n\t\t\t\tFROM \"@FEDIAN_SN_RESPO\" T" +
            "\r\n\t\t\t\tINNER JOIN \"@FEDIAN_SN\" T1 ON T.\"Code\" = T1.\"Code\" And T1.\"Code\" = (Select" +
            " \"TaxIdNum\" From \"OADM\")\r\n\t\t\t\tGROUP BY T1.\"Code\", \"U_Codigo\") A3 On A0.\"TaxIdNum" +
            "\" = A3.\"Code\"\r\n\r\nUnion All\r\n\r\nSelect \'DFE\' + \',\' + IsNull(A0.U_HBT_MunMed,\'\') + " +
            "\',\' + IsNull(Substring(A0.U_HBT_MunMed,1,2),\'\') + \',\' + IsNull(A0.Country,\'\') + " +
            "\',\' + IsNull(A1.ZipCode,\'\') + \',\' +\r\nISNull(A3.Name,\'\') + \',\' + IsNull(A2.Name,\'" +
            "\') + \',\' + IsNull(A2.U_NomDepartamento,\'\') + \',\' + \'\' as \'cadena\'\r\nFrom OADM A0\r" +
            "\nInner Join ADM1 A1 ON A0.Code= A1.Code\r\nLeft Join \"@HBT_MUNICIPIO\" A2 On A0.U_H" +
            "BT_MunMed = A2.Code\r\nLeft Join OCRY A3 On A0.Country = A3.Code\r\n\r\nUnion All\r\n\r\nS" +
            "elect \'CDE\' + \',\' + \'1\' + \',\' + IsNull(A0.Manager,\'\') + \',\' + IsNull(A0.Phone1,\'" +
            "\') + \',\' + IsNull(A0.E_Mail,\'\')\r\n+ \',\' + \'\' + \',\' + \'\' As \'Cadena\'\r\nFrom OADM A0" +
            "\r\n\r\nUnion ALL\r\n\r\nSelect \'GTE\' + \',\' + IsNull(A2.U_Codigo,\'\') + \',\' + IsNull(A2.U" +
            "_Desc,\'\') As \'Cadena\'\r\nFrom OADM A0\r\nInner Join [@FEDIAN_SN] A1 On A0.TaxIdNum =" +
            " A1.Code\r\nInner Join [@FEDIAN_SN_TRIB] A2 On A1.Code = A2.Code\r\n\r\nUnion All\r\n\r\nS" +
            "elect \'ADQ\' + \',\' + Case When A1.U_HBT_TipEnt = \'1\' Then \'2\' When A1.U_HBT_TipEn" +
            "t = \'2\' Then \'1\' Else \'1\' End + \',\' + \r\nCase When CharIndex(\'-\', A1.LicTradNum) " +
            "= 0 Then A1.LicTradNum Else SubString(A1.LicTradNum, 1, CharIndex(\'-\', A1.LicTra" +
            "dNum)-1) End \r\n+ \',\' + IsNull(A1.U_HBT_TipDoc,\'\')  + \',\' + \'48\'  \r\n+ \',\' + \'\' + " +
            "\',\' + Case When IsNull(A1.U_HBT_TipEnt,\'\') = \'1\' Then (IsNull(A1.U_HBT_Nombres,\'" +
            "\') + \' \' + IsNull(A1.U_HBT_Apellido1,\'\') + \' \' + IsNull(A1.U_HBT_Apellido2,\'\')) " +
            "Else A1.CardName End + \',\' +\r\nCase When IsNull(A1.U_HBT_TipEnt,\'\') = \'1\' Then (I" +
            "sNull(A1.U_HBT_Nombres,\'\') + \' \' + IsNull(A1.U_HBT_Apellido1,\'\') + \' \' + IsNull(" +
            "A1.U_HBT_Apellido2,\'\')) Else A1.CardName End + \',\' + \r\nCase When IsNull(A1.U_HBT" +
            "_TipEnt,\'\') = \'1\' Then (IsNull(A1.U_HBT_Nombres,\'\') + \' \' + IsNull(A1.U_HBT_Apel" +
            "lido1,\'\') + \' \' + IsNull(A1.U_HBT_Apellido2,\'\')) Else A1.CardName End + \',\' + \'\'" +
            " + \',\' + \'\' + \',\' +\r\nIsNull(SubString(A1.U_HBT_MunMed,1,2),\'\') + \',\' + IsNull(A1" +
            ".Address,\'\') + \',\' + IsNull(A2.Name,\'\') + \',\' + IsNull(A1.ZipCode,\'\') + \',\' + Is" +
            "Null(A1.Country,\'\') + \',\' +\r\n\'\' + \',\' + \'\' + \',\' + \'\' + \',\' + IsNull(A2.U_NomDep" +
            "artamento,\'\') + \',\' + \'\' +\',\' + IsNull(A3.Name,\'\') + \',\' +\r\nCase When CharIndex(" +
            "\'-\', A1.LicTradNum) != 0 Then SubString(A1.LicTradNum, CharIndex(\'-\', A1.LicTrad" +
            "Num)+1, Len(A1.LicTradNum)) Else \'\' End + \',\' +\r\nIsNull(A1.U_HBT_MunMed,\'\') + \'," +
            "\' + \'\'  As \'Cadena\'\r\nFrom OINV A0 \r\nInner Join OCRD A1 On A0.CardCode = A1.CardC" +
            "ode\r\nLeft Join \"@HBT_MUNICIPIO\" A2 On A1.U_HBT_MunMed = A2.Code\r\nLeft Join OCRY " +
            "A3 On A1.Country = A3.Code\r\nWhere A0.DocEntry = {0}\r\n\r\nUnion All\r\n\r\n\r\nSelect \'TC" +
            "R\' + \',\' + IsNull(A2.U_Codigo,\'\') + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + " +
            "\',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + \'\'\r\nas \'cadena\'\r\nFr" +
            "om OINV A0\r\nInner Join OCRD A1 ON A0.CardCode = A1.CardCode\r\nInner Join (SELECT " +
            "Top 1 T1.Code, U_Codigo=STUFF(\r\n\t\t\t\t\t(SELECT \';\' + U_Codigo AS [text()]\r\n\t\t\t\t\t\tF" +
            "ROM [@FEDIAN_SN_RESPO] XT\r\n\t\t\t\t\t\tINNER JOIN [@FEDIAN_SN] XT1 ON XT.Code = XT1.Co" +
            "de\r\n\t\t\t\t\t\t--*************CAMBIAR DOCENTRY POR VARIABLE*************\r\n\t\t\t\t\t\tWhere" +
            " XT1.Code = (Select CardCode From OINV Where DocEntry = {0})\r\n\t\t\t\t\t\tOrder By U_C" +
            "odigo\r\n\t\t\t\t\t\tFOR XML PATH(\'\')), 1, 1, \'\') \r\n\t\t\t\t\tFROM [@FEDIAN_SN_RESPO] T\r\n\t\t\t\t" +
            "\tINNER JOIN [@FEDIAN_SN] T1 ON T.Code = T1.Code And T1.Code = (Select CardCode F" +
            "rom OINV Where DocEntry = {0})\r\n\t\t\t\t\tGROUP BY T1.Code, U_Codigo) A2 On A1.CardCo" +
            "de = A2.Code\r\nWhere A0.DocEntry = {0}\r\n\r\nUnion All\r\n\r\nSelect \'ILA\' + \',\' + A1.Ca" +
            "rdName + \',\' + \r\nCase When CharIndex(\'-\', A1.LicTradNum) = 0 Then A1.LicTradNum " +
            "Else SubString(A1.LicTradNum, 1, CharIndex(\'-\', A1.LicTradNum)-1) End \r\n+ \',\' + " +
            "IsNull(A1.U_HBT_TipDoc,\'\') + \',\' + \r\nCase When CharIndex(\'-\', A1.LicTradNum) != " +
            "0 Then SubString(A1.LicTradNum, CharIndex(\'-\', A1.LicTradNum)+1, Len(A1.LicTradN" +
            "um)) Else \'\' End As \'Cadena\'\r\nFrom OINV A0 \r\nInner Join OCRD A1 On A0.CardCode =" +
            " A1.CardCode\r\nWhere A0.DocEntry = {0}\r\n\r\nUnion All\r\n\r\nSelect \'DFA\' + \',\' + IsNul" +
            "l(A1.Country,\'\') + \',\' + IsNull(SubString(A1.U_HBT_MunMed,1,2),\'\') + \',\' + IsNul" +
            "l(A1.ZipCode,\'\') + \',\' + IsNull(A1.U_HBT_MunMed,\'\') + \',\' + \r\nIsNull(A2.Name,\'\')" +
            " + \',\' + IsNull(A3.Name,\'\') + \',\' + IsNull(A3.U_NomDepartamento,\'\') + \',\' + \'\' A" +
            "s \'Cadena\'\r\nFrom OINV A0\r\nInner Join OCRD A1 On A0.CardCode = A1.CardCode\r\nLeft " +
            "Join OCRY A2 On A1.Country = A2.Code\r\nLeft Join \"@HBT_MUNICIPIO\" A3 On A1.U_HBT_" +
            "MunMed = A3.Code\r\nWhere A0.DocEntry = {0}\r\n\r\nUnion All\r\n\r\nSelect \'GTA\' + \',\' + I" +
            "sNull(A2.U_Codigo,\'\') + \',\' + IsNull(A2.U_Desc,\'\') As \'Cadena\'\r\nFrom OINV A0\r\nIn" +
            "ner Join [@FEDIAN_SN] A1 On A0.CardCode = A1.Code\r\nInner Join [@FEDIAN_SN_TRIB] " +
            "A2 On A1.Code = A2.Code\r\nWhere A0.DocEntry = {0}\r\n\r\nUnion All\r\n\r\nSelect \'TOT\' + " +
            "\',\' + \r\nCast(Cast(Sum(A1.Linetotal) as decimal (15,6)) as Nvarchar(100)) + \',\' +" +
            " Case When A0.DocCur = \'$\' Then \'COP\' Else A0.DocCur End + \',\' + \r\nCast(Cast(A0." +
            "BaseAmnt as decimal (15,6)) as Nvarchar(100)) + \',\' + Case When A0.DocCur = \'$\' " +
            "Then \'COP\' Else A0.DocCur End + \',\' + \r\nCast(Cast(A0.DocTotal as decimal (15,6))" +
            " as Nvarchar(100)) + \',\' + Case When A0.DocCur = \'$\' Then \'COP\' Else A0.DocCur E" +
            "nd + \',\' + \r\nCast(Cast(Sum(A1.Linetotal)-A0.DiscSum+A0.VatSum as decimal (14,0))" +
            " as Nvarchar(100)) + \',\' + Case When A0.DocCur = \'$\' Then \'COP\' Else A0.DocCur E" +
            "nd + \',\' + \r\nCast(Cast(A0.DiscSum as decimal (15,6)) as Nvarchar(100)) + \',\' + C" +
            "ase When A0.DocCur = \'$\' Then \'COP\' Else A0.DocCur End + \',\' + \r\nCast(Cast(A0.Va" +
            "tSum as decimal (15,6)) as Nvarchar(100)) + \',\' + Case When A0.DocCur = \'$\' Then" +
            " \'COP\' Else A0.DocCur End + \',\' + \r\nCast(Cast(A0.DpmAmnt as decimal (15,6)) as N" +
            "varchar(100)) + \',\' + Case When A0.DocCur = \'$\' Then \'COP\' Else A0.DocCur End + " +
