            " = A1.DocEntry\r\nWhere A0.DocEntry = {0}\r\nGroup By A0.DocCur, A0.BaseAmnt, A0.Doc" +
            "Total, A0.DiscSum, A0.VatSum, A0.DpmAmnt\r\n\r\nUnion All\r\n\r\nSelect \'TIM\' + \',\' + \'f" +
            "alse\' + \',\' + \r\nCast(Cast(A0.VatSum as decimal (15,6)) as Nvarchar(100))  + \',\' " +
            "+ Case When A0.DocCur = \'$\' Then \'COP\' Else A0.DocCur End As \'Cadena\'\r\nFrom OINV" +
            " A0\r\nWhere A0.DocEntry = {0} And IsNull(A0.VatSum ,0) != 0\r\n\r\nUnion All\r\n\r\nSelec" +
            "t \'IMP\' + \',\' + IsNull(A2.U_SEI_FETributo,\'\') + \',\' + \r\nCast(Cast(Sum(A1.BaseSum" +
            ") as decimal (15,6)) as Nvarchar(100)) + \',\' + \r\nCase When A0.DocCur = \'$\' Then " +
            "\'COP\' Else A0.DocCur End + \',\' +\r\nCast(Cast(Sum(A1.TaxSum) as decimal (15,6)) as" +
            " Nvarchar(100)) + \',\' +\r\nCase When A0.DocCur = \'$\' Then \'COP\' Else A0.DocCur End" +
            " + \',\' + \r\nCast(Cast(A1.TaxRate as decimal (14,2)) as Nvarchar(100)) \r\n+ \',\' + \'" +
            "\' + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' As \'Cadena\'\r\nFrom OINV A0\r\nInner Join INV4 A1" +
            " On A0.DocEntry = A1.DocEntry\r\nInner Join OSTC A2 On A1.StcCode = A2.Code\r\nWhere" +
            " A0.DocEntry = {0} And IsNull(A1.TaxSum ,0) != 0\r\nGroup By A0.DocCur, A1.TaxRate" +
            ", A2.U_SEI_FETributo\r\n\r\nUnion All\r\n\r\nSelect \'DSC\' + \',\' + \'false\' + \',\' + \r\nCast" +
            "(Cast(A0.DiscPrcnt as decimal (15,2)) as Nvarchar(100)) + \',\' + Cast(Cast(A0.Dis" +
            "cSum as decimal (15,6)) as Nvarchar(100)) + \',\' + \r\nCase When A0.DocCur = \'$\' Th" +
            "en \'COP\' Else A0.DocCur End + \',\' + IsNull(A0.U_SEI_FEDescu,\'\') + \',\' + IsNull(A" +
            "2.Descr,\'\') + \',\' +\r\nCast(Cast(Sum(A3.LineTotal) as decimal (15,6)) as Nvarchar(" +
