            "\'\' + \',\' + \'1\'  As \'Cadena\'\r\nFrom OINV A0\r\nLeft Join CUFD A1 On A1.TableID = \'OI" +
            "NV\' And A1.AliasID = \'SEI_FEDescu\'\r\nLeft Join UFD1 A2 On A2.TableID = A1.TableID" +
            " And A2.FieldID = A1.FieldID And A0.U_SEI_FEDescu = A2.FldValue\r\nLeft Join INV1 " +
            "A3 On A0.DocEntry = A3.DocEntry\r\nWhere A0.DocEntry = {0} And IsNull(A0.DiscSum,0" +
