            "InitialNum as int) as Nvarchar(100)),\'\') + \',\' + IsNull(Cast(Cast(A1.LastNum as " +
            "int) as Nvarchar(100)),\'\')\r\nFrom OINV A0\r\nInner Join NNM1 A1 On A0.Series = A1.S" +
            "eries\r\nInner Join \"@FEDIAN_NUMAUTORI\" A2 On A1.Series = A2.Code\r\nWhere A0.DocEnt" +
            "ry = {0} And IsNull(A1.LastNum,\'\') != \'\'\r\n\r\nUnion All\r\n\r\nSelect \r\n\'NOT,2_ La mer" +
            "cancía viaja por cuenta y riesgo del comprador. El vendedor se reserva el derech" +
            "o de dominio sobre la mercancía hasta su pago total. Con esta firma el comprador" +
