            "\r\n\r\nUnion All\r\n\r\nSelect \'NOT,12_ \' + REPLACE(REPLACE(REPLACE(Cast(IsNull(A0.Comm" +
            "ents,\'\') as Nvarchar(max)),CHAR(10),\' \'),CHAR(13),\' \'), \',\', \';\') As \'Cadena\'\r\nF" +
            "rom OINV A0\r\nInner Join OADM A1 On 1 =1 \r\nWhere A0.DocEntry = {0} And IsNull(A0." +
