            "INV A0\r\nInner Join INV5 A1 ON A0.DocEntry = A1.AbsEntry \r\nInner Join OWHT A2 On " +
            "A1.WTCode = A2.WTCode\r\nWhere A2.U_HBT_TipoAutoRet = \'4\' And A2.U_HBT_TipRet != \'" +
