            "DocCur\r\n\r\nUnion All\r\n\r\nSelect \'MEP\' + \',\' + IsNull(A0.U_SEI_FEMedPago,\'\') + \',\' " +
            "+ Case When A1.\"ExtraMonth\" + A1.\"ExtraDays\" <= 0 Then \'1\' Else \'2\' End  + \',\' +" +
            "\r\nConvert(char(10), A0.DocDueDate,126) + \',\' + \'\' + \',\' + \'\' + \',\' + \'\' + \',\' + " +
