            "t \'CDN\' + \',\' + A0.U_SEI_FEConcepND + \',\' + A2.Descr + \',\' + \'\'\r\nFrom OINV A0\r\nI" +
            "nner Join CUFD A1 On A1.TableID = \'OINV\' And A1.AliasID = \'SEI_FEConcepND\'\r\nInne" +
            "r Join UFD1 A2 On A2.TableID = A1.TableID And A2.FieldID = A1.FieldID And A0.U_S" +
            "EI_FEConcepND = A2.FldValue\r\nWhere A0.DocEntry = {0}\r\n\r\nUnion All\r\n\r\nSelect \'DCN" +
